angular.module("app").run(["$templateCache", function($templateCache) {$templateCache.put("/app/application/template.html","<div class=container><h1>Power BI - Sample - Client - Angular</h1><p>Demonstrate how to consume Power BI API and render using angular component. <a href=https://github.com/Microsoft/PowerBI-Angular target=_blank>PowerBI-Angular</a></p><h2>Scenarios:</h2><ul class=\"nav nav-pills\"><li role=presentation ui-sref-active=active><a ui-sref=application.scenario1>Scenario 1: Static Embed</a></li><li role=presentation ui-sref-active=active><a ui-sref=application.scenario2>Scenario 2: Dynamic Embed</a></li><li role=presentation ui-sref-active=active><a ui-sref=application.scenario3>Scenario 3: Custom Page Navigation</a></li></ul><hr class=m-y-md><div ui-view=main>Loading...</div></div>");
$templateCache.put("/app/scenario1/template.html","<h1>Scenario 1</h1><p>Static: Report to embed is known by the developer: {{vm.model.id}}</p><powerbi-report embed-url=vm.model.embedUrl access-token=vm.model.accessToken class=powerbi-frame--dotted></powerbi-report>");
$templateCache.put("/app/scenario3/template.html","<h1>Scenario 3</h1><h2>Custom Page Navigation</h2><p>Page navigation is hidden in the embedded report and recreated by developer to allow custom branding or even automation to tell stories and navigate user.</p><powerbi-component options=vm.embedConfiguration id=reportcustompagenav class=powerbi-container on-embedded=vm.onEmbedded($embed)></powerbi-component><h3 class=text-center>{{vm.activePage.displayName}}</h3><powerbi-page-navigation active-page=vm.activePage pages=vm.pages on-cycle-clicked=vm.cyclePageClicked() on-previous-clicked=vm.previousPageClicked() on-next-clicked=vm.nextPageClicked() on-page-clicked=vm.pageClicked($page)></powerbi-page-navigation>");
$templateCache.put("/app/scenario2/template.html","<h1>Scenario 2</h1><p>Dynamic: Report to embed is chosen by the user.</p><p>Example: Search reports by name, render selected report.</p><small>Hint: Type \'Re\' in the text field and search to find all reports that begin with \'Re\'</small><form id=search-form class=form-inline><div class=form-group><label for=searchinput>Search</label> <input type=text ng-model=vm.searchInput class=form-control id=searchinput required placeholder=\"Enter report name\" autocomplete=off></div><button type=submit class=\"btn btn-primary\">Search</button> <button type=button class=\"btn btn-success\" ng-click=vm.showAllClicked()>Show All</button><div class=checkbox><label for=filterPaneCheckbox><input type=checkbox name=filterPaneCheckbox id=filterPaneCheckbox checked> Enable filter pane when embedding report.</label></div></form><p class=reportslistdescription>Total Results: <span id=reportslistcount>{{vm.reports.length}}<span></span></span></p><ol id=reportslist><li ng-repeat=\"report in vm.reports\"><span class=report-name>{{report.name}}</span> <button type=button class=\"btn btn-success\" ng-click=vm.embedReport(report)>Embed!</button></li></ol><p class=text-right><button type=button class=\"btn btn-danger\" ng-click=vm.resetClicked()>Reset</button></p><powerbi-component options=vm.report></powerbi-component>");
$templateCache.put("/app/components/powerbi-page-navigation/template.html","<div class=powerbi-page-navigation><button type=button id=prevbutton class=\"powerbi-page-navigation__previous btn btn-primary\" ng-click=vm.previousPageClicked()>&lt; Prev</button><div id=reportpagesbuttons class=powerbi-page-navigation__pages><button type=button class=\"btn btn-success\" ng-class=\"{ \'active\': page.name === vm.activePage.name }\" ng-repeat=\"page in vm.pages\" ng-click=vm.pageClicked(page);>{{page.displayName}}</button> <span ng-if=\"vm.pages.length === 0\">No pages loaded</span></div><button type=button id=cyclebutton class=\"powerbi-page-navigation__cycle btn btn-warning\" ng-class=\"{\'active\': vm.cycleIsEnabled }\" ng-click=vm.cyclePageClicked()><span ng-show=vm.cycleIsEnabled>Disable</span><span ng-show=!vm.cycleIsEnabled>Enable</span> Cycle</button> <button type=button id=nextbutton class=\"powerbi-page-navigation__next btn btn-primary\" ng-click=vm.nextPageClicked()>Next &gt;</button></div>");}]);